!function(){"use strict";String.prototype._encode=function(){return this.split("").map(function(t,n,r){var o=t.charCodeAt(0).toString(16).toUpperCase();return o.length>2?o+"1":t}).join(" ")},String.prototype._decode=function(){return this.split("").map(function(t,n,r){var o=t.charCodeAt(0).toString(16).toUpperCase();return o.length>2?o.slice(0,-1):t}).join(" ")},String.prototype._toArray=function(){return this.split(" ")}}();